import './App.css';

function Blog() {
    return (
      <div className="App">
        <header align="left">
          <h1>
            August 2021
          </h1>
          <p>
              Moved to Pittsburgh. Excited to start grad school at Carnegie Mellon this fall!
          </p>
          <p>
              Website published.
          </p>
        </header>
      </div>
    );
  }
  
  export default Blog;
